import React, { useState } from "react";
import AddUser from "./components/Users/AddUser";
import UsersList from "./components/Users/UsersList";
const App = () => {
  const [userList, setUserList] = useState([]);
  return (
    <div>
      <AddUser />
      <UsersList users={userList} />
    </div>
  );
};

export default App;
